INSERT INTO `components` VALUES (1,'CLO1','Mampu menemukan GAP antara kebutuhan/permasalahan dengan kondisi eksisting organisasi/perusahaan',NULL,'1. GAP antara kebutuhan/permasalahan dengan kondisi eksisting tidak terdefinisikan dengan baik\r\n2. GAP antara kebutuhan/permasalahan dengan kondisi eksisting terdefinisikan dengan baik\r\n3. Butir [2] dan terdapat data pendukung adanya GAP kebutuhan/permasalahan dengan kondisi eksisting\r\n4. Butir [2] + [3] dan terdapat analisa tentang akar penyebab adanya GAP kebutuhan/permasalahan dengan kondisi eksisting',1,1,1),(2,'CLO2','Mampu mencari referensi dalam penentuan metodologi penyelesaian masalah',NULL,'1. Metodologi penyelesaian masalah tidak ada/jelas atau tidak bersumber dari referensi yang baik.\r\n2. Metodologi penyelesaian masalah bersumber dari referensi yang baik dan relevan dengan keilmuan program studi.\r\n3. Butir [2] dan mempunyai lebih dari satu opsi metodologi penyelesaian masalah dan terdapat alasan pemilihan metodologi penyelesaian masalah.\r\n4. Butir [3] dan mempunyai referensi dari buku dan artikel ilmiah yang diterbitkan kurang dari 5 tahun terakhir.',1,1,2),(3,'CLO3','Mampu mencari data/requirement dan mengolah/menggunakan data/requirement sesuai dengan metodologi penyelesaian masalah yang telah dipilih',NULL,'1. Penelitian tidak dilengkapi dengan data/requirement yang relevan\r\n2. Penelitian didukung dengan data/requirement yang relevan, namun tidak diolah atau digunakan sesuai dengan metodologi yang telah dipilih\r\n3. Penelitian didukung dengan data/requirement yang relevan dan diolah/digunakan sesuai dengan metodologi yang telah dipilih\r\n4. Penelitian didukung dengan data/requirement yang relevan dan diolah/digunakan sesuai dengan metodologi yang telah dipilih, serta mampu menjelaskan berdasarkan referensi yang ada',1,1,3),(4,'CLO4','Mampu menverifikasi dan menvalidasi hasil penelitian.',NULL,'1. Tidak adanya proses verifikasi hasil penelitian (Terdapat kesalahan dalam menggunakan dan mengolah data)\r\n2. Tidak ada kesalahan dalam melalkuikan verifikasi hasil penelitian\r\n3. Terdapat validasi hasil penelitian sehingga dapat meminimasi GAP kebutuhan/permasalahan\r\n4. Terdapat analisis keterbatasan hasil penelitian (pada proses validasi) dan analisis dampak pengimplementasian hasil penelitian',1,1,4),(5,'CLO5','Mampu menentukan manfaat dari proyek Tugas Akhir yang dikerjakan',NULL,'1. Penelitian tidak memiliki manfaat yang jelas dan sulit untuk diterapkan\r\n2. Penelitian mempunyai manfaat yang jelas, namun sulit untuk diterapkan\r\n3. Penelitian mempunyai manfaat yang jelas dan dapat diterapkan\r\n4. Penelitian memiliki manfaat yang jelas dan terdapat bukti untuk diimplementasikan di perusahaan',1,1,5),(6,'CLO6','Mampu membuat laporan Tugas Akhir sesuai kaidah struktur dan tata bahasa yang digunakan',NULL,'•	Terdapat kesesuaian antara paragraph\r\n•	Satu paragraf mempunyai satu ide gagasan\r\n•	Penggunaan kalimat yang standar dan baku\r\n•	Terdapat kesesuaian penulisan antara latar belakang, rumusan masalah, sampai dengan kesimpulan\r\n•	Setiap tabel dan gambar mempunyai penjelasan yang sesuai dan penempatan yang baik\r\n•	Penulisan (pemilihan kata dan kalimat) jelas, tidak bertele-tele, dan konsisten',1,1,6),(7,'CLO7','Mampu menulis laporan secara rapi dan sesuai aturan penulisan Tugas Akhir',NULL,'•	Format sesuai\r\n•	Terdapat daftar isi, daftar gambar, daftar tabel, daftar istilah, dan daftar Pustaka\r\n•	Referensi dan sitasi ditulis dengan format sesuai dan konsisten\r\n•	Penyajian gambar secara jelas (resolusi cukup)\r\n•	Penyajian tabel secara jelas (tidak print screen) dan konsisten dengan format',0,1,7),(8,'CLO7','Mampu menulis laporan secara rapi dan sesuai aturan penulisan Tugas Akhir',NULL,'•	Format sesuai\r\n•	Terdapat daftar isi, daftar gambar, daftar tabel, daftar istilah, dan daftar Pustaka\r\n•	Referensi dan sitasi ditulis dengan format sesuai dan konsisten\r\n•	Penyajian gambar secara jelas (resolusi cukup)\r\n•	Penyajian tabel secara jelas (tidak print screen) dan konsisten dengan format',1,0,8),(9,'CLO8','Mampu berkomunikasi secara lisan untuk menyampaikan proyek Tugas Akhir secara terstruktur',NULL,'•	Presentasi dilakukan dengan tidak membaca slide\r\n•	Presentasi sesuai dengan slide yang ditampilkan\r\n•	Gagasan yang tertulis secara implisit pada slide dapat dipaparkan secara jelas di presentasi.\r\n•	slide presentasi dapat menggambarkan proses penelitian dengan jela\r\n•	Presentasi disampaikan dengan bahasa yang baik dan jelas',0,1,9),(10,'CLO8','Mampu berkomunikasi secara lisan untuk menyampaikan proyek Tugas Akhir secara terstruktur',NULL,'•	Presentasi dilakukan dengan tidak membaca slide\r\n•	Presentasi sesuai dengan slide yang ditampilkan\r\n•	Gagasan yang tertulis secara implisit pada slide dapat dipaparkan secara jelas di presentasi.\r\n•	slide presentasi dapat menggambarkan proses penelitian dengan jela\r\n•	Presentasi disampaikan dengan bahasa yang baik dan jelas',1,0,10),(11,'CLO9','Mampu menjawab dan bertahan terhadap ide gagasan',NULL,'1. Mahasiswa tidak mampu menjawab pertanyaan dan/atau mempertahankan ide tugas akhir\r\n2. Mahasiswa mampu menjawab pertanyaan dan/atau mempertahankan ide tugas akhir dengan baik > 40%\r\n3. Mahasiswa mampu menjawab pertanyaan dan/atau ide tugas akhir dengan baik > 75%\r\n4. Butir [3] dan pemaparan jawaban/ide disertai dengan referensi yang relevan',1,1,11),(12,'CLO10','Mampu bekerja mandiri dalam menyelesaikan permasalahaan TA untuk menacapai tujuan TA sesuai dengan metode yang digunakan',NULL,'•	Memiliki inisiatif dan tidak menunggu instruksi dari dosen pembimbing dalam proses bimbingan\r\n•	Proses bimbingan dilakukan secara teratur dan konsisten\r\n•	Bersikap kooperatif dan menjunjung tinggi etika dalam proses bimbingan',1,0,12),(13,'CLO11','Mampu berkomunikasi secara formal maupun non formal dalam menyampaikan ide atau gagasannya',NULL,'•	Mampu mengkomunikasikan ide/gagasan secara terstruktur dan jelas\r\n•	Mempunyai referensi dalam penyampaian ide/gagasan\r\n•	Penyampaian ide dan gagasan dilakukan dengan media yang tepat (slide presentasi dan/atau laporan kemajuan)',1,0,13),(14,'CLO1','Mampu menemukan GAP antara kebutuhan/permasalahan dengan kondisi eksisting organisasi/perusahaan',NULL,'1. GAP antara kebutuhan/permasalahan dengan kondisi eksisting tidak terdefinisikan dengan baik\r\n2. GAP antara kebutuhan/permasalahan dengan kondisi eksisting terdefinisikan dengan baik\r\n3. Butir [2] dan terdapat data pendukung adanya GAP kebutuhan/permasalahan dengan kondisi eksisting\r\n4. Butir [2] + [3] dan terdapat analisa tentang akar penyebab adanya GAP kebutuhan/permasalahan dengan kondisi eksisting',1,1,14),(15,'CLO2','Mampu mencari referensi dalam penentuan metodologi penyelesaian masalah',NULL,'1. Metodologi penyelesaian masalah tidak ada/jelas atau tidak bersumber dari referensi yang baik.\r\n2. Metodologi penyelesaian masalah bersumber dari referensi yang baik dan relevan dengan keilmuan program studi.\r\n3. Butir [2] dan mempunyai lebih dari satu opsi metodologi penyelesaian masalah dan terdapat alasan pemilihan metodologi penyelesaian masalah.\r\n4. Butir [3] dan mempunyai referensi dari buku dan artikel ilmiah yang diterbitkan kurang dari 5 tahun terakhir.',1,1,15),(16,'CLO3','Mampu mencari data/requirement dan mengolah/menggunakan data/requirement sesuai dengan metodologi penyelesaian masalah yang telah dipilih',NULL,'1. Penelitian tidak dilengkapi dengan data/requirement yang relevan\r\n2. Penelitian didukung dengan data/requirement yang relevan, namun tidak diolah atau digunakan sesuai dengan metodologi yang telah dipilih\r\n3. Penelitian didukung dengan data/requirement yang relevan dan diolah/digunakan sesuai dengan metodologi yang telah dipilih\r\n4. Penelitian didukung dengan data/requirement yang relevan dan diolah/digunakan sesuai dengan metodologi yang telah dipilih, serta mampu menjelaskan berdasarkan referensi yang ada',1,1,16),(17,'CLO4','Mampu menverifikasi dan menvalidasi hasil penelitian.',NULL,'1. Tidak adanya proses verifikasi hasil penelitian (Terdapat kesalahan dalam menggunakan dan mengolah data)\r\n2. Tidak ada kesalahan dalam melalkuikan verifikasi hasil penelitian\r\n3. Terdapat validasi hasil penelitian sehingga dapat meminimasi GAP kebutuhan/permasalahan\r\n4. Terdapat analisis keterbatasan hasil penelitian (pada proses validasi) dan analisis dampak pengimplementasian hasil penelitian',1,1,17),(18,'CLO5','Mampu menentukan manfaat dari proyek Tugas Akhir yang dikerjakan',NULL,'1. Penelitian tidak memiliki manfaat yang jelas dan sulit untuk diterapkan\r\n2. Penelitian mempunyai manfaat yang jelas, namun sulit untuk diterapkan\r\n3. Penelitian mempunyai manfaat yang jelas dan dapat diterapkan\r\n4. Penelitian memiliki manfaat yang jelas dan terdapat bukti untuk diimplementasikan di perusahaan',1,1,18),(19,'CLO6','Mampu membuat laporan Tugas Akhir sesuai kaidah struktur dan tata bahasa yang digunakan',NULL,'•	Terdapat kesesuaian antara paragraph\r\n•	Satu paragraf mempunyai satu ide gagasan\r\n•	Penggunaan kalimat yang standar dan baku\r\n•	Terdapat kesesuaian penulisan antara latar belakang, rumusan masalah, sampai dengan kesimpulan\r\n•	Setiap tabel dan gambar mempunyai penjelasan yang sesuai dan penempatan yang baik\r\n•	Penulisan (pemilihan kata dan kalimat) jelas, tidak bertele-tele, dan konsisten',1,1,19),(20,'CLO7','Mampu menulis laporan secara rapi dan sesuai aturan penulisan Tugas Akhir',NULL,'•	Format sesuai\r\n•	Terdapat daftar isi, daftar gambar, daftar tabel, daftar istilah, dan daftar Pustaka\r\n•	Referensi dan sitasi ditulis dengan format sesuai dan konsisten\r\n•	Penyajian gambar secara jelas (resolusi cukup)\r\n•	Penyajian tabel secara jelas (tidak print screen) dan konsisten dengan format',0,1,20),(21,'CLO7','Mampu menulis laporan secara rapi dan sesuai aturan penulisan Tugas Akhir',NULL,'•	Format sesuai\r\n•	Terdapat daftar isi, daftar gambar, daftar tabel, daftar istilah, dan daftar Pustaka\r\n•	Referensi dan sitasi ditul